package holy.vo;

public class TicketListVO {
	private TicketingVO tickvo;
	private ScheduleVO svo;
	private FilmVO fvo;
	
	public TicketListVO() {
		// TODO Auto-generated constructor stub
	}

	public TicketingVO getTickvo() {
		return tickvo;
	}

	public void setTickvo(TicketingVO tickvo) {
		this.tickvo = tickvo;
	}

	public ScheduleVO getSvo() {
		return svo;
	}

	public void setSvo(ScheduleVO svo) {
		this.svo = svo;
	}

	public FilmVO getFvo() {
		return fvo;
	}

	public void setFvo(FilmVO fvo) {
		this.fvo = fvo;
	}
	
	
	
	
}
